import React, { useState, useEffect } from "react";
import { Route } from "react-router-dom";
import axios from "axios";

// password
import Password from "./components/pages/password/Password";
import UpdatePassword from "./components/pages/password/UpdatePassword";

function User() {
  const [posts, setPosts] = useState([]);
  useEffect(() => {
    axios
      .get(" http://localhost:4000/api/user")
      .then((res) => setPosts(res.data))
      .catch((error) => console.log(error));
  });

  return (
    <div className="User">
      {/* Get Data */}
      <Route exact path="/password" render={() => <Password posts={posts} />} />

      {/* Update Data */}
      <Route
        path="/update-password/:id"
        render={(props) => <UpdatePassword {...props} posts={posts} />}
      />
    </div>
  );
}

export default User;
